import SiteLogo from '../Images/wildsteppe_logo.png';
import SiteName from '../Images/Wildsteppe_name.png';

function SiteNavBar() {

    return (
        <>
            <nav>
                <div>
                    <img src={SiteLogo}/>    
                    <img src={SiteName}/>
                </div>
                <ul>
                    <li>
                        Home
                    </li>
                    <li>
                        About
                    </li>

                </ul>                
            </nav>
        </>
    )
}

export default SiteNavBar;
